import React from "react"
import Data from "./Data"
import './index.css'
function Prodact(){
    const [bol,setbol]=React.useState(false)
    function show(){
        setbol(true)

    }   
      const arr=Data.map((el)=>{
        return(
          <div className="CardList" key={el.id}>
            <img src={el.image} alt="" />
            <h1>{el.title}</h1>
            <p>{el.description}</p>
           <div>   
           <p >{el.price}$</p>
             <button onClick={()=>show()}>To Find Out the Price</button>
          
           </div>

            </div>
        )
    
    })
    return(<div>
<div className="List">
    {arr}

</div>
</div>
    )
    }
export default Prodact
